import React from "react";

class AddBurgerForm extends React.Component {
    render() {
        return (
            <form className='burger-edit'>
                <input name='name' type='text' placeholder='Name' autoComplete='off'></input>
                <input name='price' type='text' placeholder='Price' autoComplete='off'></input>
                <select name='status' className='status'>
                    <option value='avalible'>Доступно</option>
                    <option value='unavalible'></option>
                </select>
                <input name='textarea' type='text' placeholder='Name' autoComplete='off'></input>
                <input name='image' type='text' placeholder='Name' autoComplete='off'></input>
            </form>
        )
    }

}

export default AddBurgerForm;
